// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract DecentralizedChat{
    struct GenericUser {
        string userName;
        address accountAddress;
    }

    struct Request {
        string name;
        address pubKey;
    }

    struct Message {
        address sender;
        uint256 timestamp;
        string _msg;
    }

    struct UserPrivate {
        string userName;
        address pubKey;
        Request[] pendingRequests;
        Request[] denyRequests;
        GenericUser[] friendlist;
    }

    event AccountCreated(address indexed accountAddress, string userName, uint timestamp);
    event FriendRequestSent(address indexed from, address indexed to, uint timestamp);
    event FriendRequestAccepted(address indexed from, address indexed to, uint timestamp);
    event FriendRequestDenied(address indexed from, address indexed to, uint timestamp);
    event MessageSent(address indexed from, address indexed to, string message, uint256 timestamp);



    GenericUser[] public users;
    mapping(address => UserPrivate) public addressToUserPrivate;
    mapping(address => mapping(address => bool)) public requestChecker;
    mapping(bytes32 => Message[]) public allMessages;
    function checkUserExists(address _pubkey) public view returns (bool) {
        return bytes(addressToUserPrivate[_pubkey].userName).length > 0;
    }
    function createAccount(string calldata _userName) external {
        require(!checkUserExists(msg.sender), "This user already exists!");
        require(bytes(_userName).length > 0, "Username cannot be empty");
        uint timestamp = block.timestamp;
        addressToUserPrivate[msg.sender].userName = _userName;
        addressToUserPrivate[msg.sender].pubKey = msg.sender;
        GenericUser memory newUser = GenericUser({
            userName: _userName,
            accountAddress: msg.sender
        });
        users.push(newUser);
        emit AccountCreated(msg.sender,_userName, timestamp);
    }

    function getUsername(address _pubkey) public view returns (string memory) {
        require(checkUserExists(_pubkey), "This user does not exist!");
        return addressToUserPrivate[_pubkey].userName;
    }

    function sendFriendRequest(address _sendTo) public {
        require(checkUserExists(msg.sender), "Create an account first!");
        require(
            checkUserExists(_sendTo),
            "This address does not own an account!"
        );
        require(_sendTo != msg.sender, "you cannot add yourself");
        require(!alreadyFriends(msg.sender, _sendTo), "already friends!");
        require(
            requestChecker[msg.sender][_sendTo] == false,
            "you already sent a request"
        );
        require(!requestChecker[_sendTo][msg.sender], "This user has already sent a request to you. Accept it if you want to be friends with");
        uint timestamp = block.timestamp;

        Request memory newRequest = Request({
            name: getUsername(msg.sender),
            pubKey: msg.sender
        });
        requestChecker[msg.sender][_sendTo] = true;
        addressToUserPrivate[_sendTo].pendingRequests.push(newRequest);
        emit FriendRequestSent(msg.sender, _sendTo, timestamp);
    }

    function getPendingRequests() public view returns (Request[] memory) {
        return addressToUserPrivate[msg.sender].pendingRequests;
    }
    function acceptPendingRequest(uint256 _requestIndex) public {
        Request memory requestAt;
        requestAt = addressToUserPrivate[msg.sender].pendingRequests[
            _requestIndex
        ];
        require(
            !alreadyFriends(msg.sender, requestAt.pubKey),
            "already friends!"
        );
        require(
            requestChecker[requestAt.pubKey][msg.sender] == true,
            "This friend request does not exist!"
        );
        uint timestamp = block.timestamp;
        GenericUser memory newFriend;

        newFriend.userName = requestAt.name;
        newFriend.accountAddress = requestAt.pubKey;
        addressToUserPrivate[msg.sender].friendlist.push(newFriend);
        GenericUser memory meFriend;
        meFriend.userName = addressToUserPrivate[msg.sender].userName;
        meFriend.accountAddress = msg.sender;
        addressToUserPrivate[requestAt.pubKey].friendlist.push(meFriend);
        emit FriendRequestAccepted(msg.sender, requestAt.pubKey, timestamp);
    }

    function denyPendingRequest(uint256 _requestIndex) public {
        Request memory requestAt;
        require(
            !alreadyFriends(msg.sender, requestAt.pubKey),
            "already friends!"
        );
        uint timestamp = block.timestamp;

        requestAt = addressToUserPrivate[msg.sender].pendingRequests[
            _requestIndex
        ];
        addressToUserPrivate[msg.sender].denyRequests.push(requestAt);
        emit FriendRequestDenied(msg.sender, requestAt.pubKey, timestamp);
    }

    function getDenyRequests() public view returns (Request[] memory) {
        return addressToUserPrivate[msg.sender].denyRequests;
    }

    function alreadyFriends(address _account1, address _account2)
        public
        view
        returns (bool)
    {
        uint256 myLength = addressToUserPrivate[_account1].friendlist.length;
        for (uint256 i = 0; i < myLength; i++) {
            if (
                addressToUserPrivate[_account1].friendlist[i].accountAddress ==
                _account2
            ) {
                return true;
            }
        }
        return false;
    }

    function getFriends() public view returns (GenericUser[] memory) {
        return addressToUserPrivate[msg.sender].friendlist;
    }

    function _getChatCode(address _from, address _to)
        internal
        pure
        returns (bytes32)
    {
        if (_from < _to) {
            return keccak256(abi.encodePacked(_from, _to));
        } else {
            return keccak256(abi.encodePacked(_to, _from));
        }
    }

    function sendMessage(address friend_key, string calldata _msg) external {
        require(
            checkUserExists(msg.sender),
            "Please, create an account first!"
        );
        require(checkUserExists(friend_key), "This account does not exist!");
        require(
            alreadyFriends(msg.sender, friend_key),
            "This friend is not in your list!"
        );
        require(
            alreadyFriends(friend_key, msg.sender),
            "You are not in the list of this friend!"
        );
        uint timestamp = block.timestamp;

        bytes32 chatCode = _getChatCode(msg.sender, friend_key);
        Message memory newMsg = Message({
            sender: msg.sender,
            timestamp: block.timestamp,
            _msg: _msg
        });
        allMessages[chatCode].push(newMsg);
        emit MessageSent(msg.sender, friend_key, _msg, timestamp);
    }

    function readMessage(address friend_key)
        external
        view
        returns (Message[] memory)
    {
        bytes32 chatCode = _getChatCode(msg.sender, friend_key);
        return allMessages[chatCode];
    }

}
